import './App.css';
import { BrowserRouter, Link, Route, Router, Switch, useHistory } from "react-router-dom";
import OnePost from "./components/OnePost";
import React from "react";
import HomePageComponent from './components/HomePageComponent';
import { Container, Tab, Tabs } from '@material-ui/core';

class App extends React.Component {

  handleCallToRouter = (value) => {
    this.props.history.push(value);
  }

  render(){
  return (
    <Container>
    <Tabs
      value={''}
      indicatorColor="primary"
      textColor="primary"
      centered
      onChange={this.handleCallToRouter}
      >
        <BrowserRouter>
          <Tab label="Home" component={Route} value="/">
            <HomePageComponent/>
          </Tab>
          <Tab label="SinglePage" component={Link} value="/my-first-post">
            <OnePost/>
          </Tab>
          </BrowserRouter>
    </Tabs>
     <BrowserRouter>
        <Switch>
          <Route component={HomePageComponent} path="/" exact />
          <Route component={OnePost} path="/:slug" />
        </Switch>
        </BrowserRouter>
    </Container>
  );

  }
}


export default App;
